import { useState } from 'react';

export function ProductsList({ shop }) {
  const { products, setProducts } = useState([]);

  return (
    <div>
      <h2>{shop}</h2>
      <ul>
        {products.map(product => (
          <li key={product.id}>
            <p>{product.name}</p>
            <p>{product.price}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}
